create table cities (
	city_id number not null
	, name varchar2(50) not null
	, state_id number not null
    , constraint city_pk primary key (city_id) enable
    , constraint city_fk1 foreign key (state_id) references states (state_id) enable
);





















create sequence cities_seq
minvalue 1 maxvalue 99999999999999999
increment by 1 start with 48315
nocache noorder cycle;

create or replace trigger cities_bi
before insert on cities
for each row
begin
    :new.city_id := cities_seq.nextval;
end;
/
